INSERT INTO `el_material` VALUES ('0436461fc2b94b64bc814df0c8bd7b06', '32b3d188a504438f8d867bc86afbdeb7', '世界名著告诉你心碎的感觉（下）', '**7.Memoirs of a Teenage Amnesiac, Gabrielle Zevin**\n<font color=#006200>《谁偷走我的吻》 加布瑞埃拉·泽文</font>\n\n**My hear was a little bit broken, but I still had to go to school. I buttoned my dress shirt over it and my winter coat, too. I hoped it didn’t show too much.**\n<font color=#006200>我的心碎了，但是我仍然必须要去学校。我用衬衫和冬衣遮住我的心痛，我希望它不要太明显。</font>\n\n**Why this breaks your heart: You eventually move on, or at least go through the motions of moving on. You wonder whether everyone else can see that you are slowly falling apart, and even more slowly mending yourself back together.**\n<font color=#006200>心碎理由：最终，你对曾经的伤害释怀了，或者至少表面上释怀了。你害怕别人看出，你在慢慢地崩溃、抑或是缓慢疗伤。</font>\n \n\n\n**8.This Is How You Lose Her, Junot Díaz**\n<font color=#006200>《你是怎么失去她的》 朱诺·迪亚斯</font>\n\n**It\'s just a matter of willpower. The day you decide it\'s over, it\'s over.**\n<font color=#006200>这只与意志力有关。你决定分手那一天，你们俩就结束了。</font>\n\n**You never get over it.**\n<font color=#006200>你却永远无法从心碎中恢复。</font>\n\n**Why this breaks your heart: You continue. You get up, you go to bed, you do all the little things in between until they don\'t seem like just little things in between. Heartbreak continues until it doesn\'t. (It never doesn\'t.)**\n<font color=#006200>心碎理由：你继续生活、起床、睡觉、做着往昔你们俩一起做过的小事，直到有一天你意识到这些小事不再是你们俩之间的小浪漫。你不断地心碎，直到不再感受得到痛。（但是它一直都很痛。）</font>\n \n\n\n**9.A Tree Grows in Brooklyn, Betty Smith**\n<font color=#006200>《布鲁克林有棵树》 贝蒂·史密斯</font>\n\n**Oh, you\'ll be happy, again, never fear. But you won\'t forget. Every time you fall in love it will be because something in the man remi</font>nds you of him.**\n<font color=#006200>哦，别担心，你会再次快乐起来的，但是你不会忘记这段感情。每当你爱上新的人，都只是因为这人身上有他的影子。</font>\n\n**Why this breaks your heart: The people you love, the people you\'ve spend time with and energy on, leave an imprint on you. The silver lining? It\'s often up to us whether that means we\'re worse off or changed for the better.**\n<font color=#006200>心碎理由：你爱的人，为之花时间精力的人，都在你的心里留下深深的印记。乌云背后的幸福线？很多时候，失恋后时好时坏、这取决于我们自己。</font>\n \n\n\n**10.The Little Prince, Antoine de Saint-Exupéry**\n<font color=#006200>《小王子》 安东尼·德·圣-埃克苏佩里</font>\n\n**So the little prince tamed the fox. And when the hour of his departure drew near. \"Ah,\" said the fox, \"I shall cry.\"**\n<font color=#006200>于是小王子驯服了狐狸。当他要离开的时候，狐狸说，“啊，我要哭了。”</font>\n\n**\"It is your own fault,\" said the little prince. I never wished you any sort of harm, but you wanted me to tame you...**\n<font color=#006200>“这是你自己犯的错。我从没有想过伤害你，但是你想要被我驯服，”小王子说。</font>\n\n**\"Yes, that is so,\" said the fox.**\n<font color=#006200>“是的，是这样，”狐狸说。</font>\n\n**\"But now you are going to cry!\" said the little prince.**\n<font color=#006200>“但是你却要哭了！”小王子说。</font>\n\n**\"Yes, that is so,\" said the fox.**\n<font color=#006200>“是的，是这样，”狐狸说。</font>\n\n**Why this breaks your heart: That pain is awful, your heart feeling like a dead thing in your chest. But it doesn\'t mean love is never worth it.**\n<font color=#006200>心碎理由：你真的很痛，你的心脏感觉就像停止跳动了一样。但这并不是说爱永远都不值得这种撕心裂肺的疼痛。</font>\n \n\n\n**11.Mr. Fox, Helen Oyeyemi**\n<font color=#006200>《狐狸先生》 海伦·奥耶耶美</font>\n\n**Her heart was heavy because it was open, and so things filled it, and so things rushed out of it, but still the heart kept beating, tough and frighteningly powerful and meaning to shrug off the rest of her and continue on its own.**\n<font color=#006200>她的心很沉重，因为她的心胸是敞开的，所以东西可以把它填满，也能清空，但是心还在不停的跳，艰难但非常有力，试图摆脱她的身体，独自跳动下去。</font>\n\n**Why this breaks your heart: It will always be risky, keeping your heart open and soft and pliable. It makes you vulnerable. But it will also make it stronger over time. Break it and re-build it, again and again. That’s what it\'s for.**\n<font color=#006200>心碎理由：敞开你那柔软易受伤害的心一直都是很危险的。这让你很脆弱。但是随着时间的变迁，它会让你越来越坚强。不断心碎或者不断重塑。这是心存在的原因。</font>\n \n\n\n**12.Heartburn, Nora Ephron**\n<font color=#006200>《心痛》 诺拉·伊佛朗</font>\n\n**And then the dreams break into a million tiny pieces. The dream dies, which leaves you with a chioce: you can settle for reality, or you can go off, like a fool, and dream another dream.**\n<font color=#006200>然后美梦变得支离破碎，碎成几百万个小碎片。梦碎了，你也必须选择，是因为现实而安定下来，还是像个傻瓜一样、去追寻另一个梦。</font>\n\n**Why this breaks your heart: Things end. They do. They die and they fade and they wither or they just went away when you weren\'t paying attention. The foolish thing to do is go after a new beginning. So go out and be a fool. It\'s so worth it.**\n<font color=#006200>心碎理由：所有事都终结了。你不关心的时候，它们死亡、淡出记忆、枯萎或离去。开始追寻一个新的梦想会成别人眼里的傻瓜。别担心，就去做个傻瓜吧，因为它值得。</font>', 'article-essay', '2021-01-05 11:00:04');
INSERT INTO `el_material` VALUES ('05777d0258194e0295cdaa46feb796ff', '32b3d188a504438f8d867bc86afbdeb7', 'Education', '![Home-education.jpg](http://file.yongkj.cn/fileSystem/admin/Resources/英语随身学/assets/Picture/Home-education.jpg)\n\n&emsp;&emsp;Chinese families attach great importance to their children\'s education. Many parents believe that they should work hard to ensure that their children are well educated. Not noly are they perfectly willing to invest in their children\'s education, but they also spend a lot of time urging their children to learn. Most parents hope that their children will attend a prestigious university. Due to the reform and opening up, more and more parents can send their children abroad to study or participate in international exchange programs to broaden their horizons. Through these efforts, they expect their children to grow healthily and contribute to the development and prosperity of the country.\n\n&emsp;&emsp;中国家庭十分重视孩子的教育。许多父母认为应该努力工作，确保孩子受到良好教育。他们不仅非常情愿为孩子的教育投资，而且花很多时间督促他们学习。多数家长希望孩子能上名牌大学。由于改革开放，越来越多的家长能送孩子到国外学习或参与国际交流项目，以拓宽其视野。通过这些努力，他们期望孩子健康成长，为国家的发展和繁荣作出贡献。', 'article-essay', '2020-12-10 13:16:52');
