INSERT INTO `el_material` VALUES ('1e7bb610d1694d2597661d2dd5007563', '32b3d188a504438f8d867bc86afbdeb7', 'Proud of you - 冯曦妤', '<iframe src=\"https://player.bilibili.com/player.html?cid=74005765&aid=42158494&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n作词 : Anders Lee\n作曲 : 陈光荣\n\nLove in your eyes\n你的眼中闪烁着爱意\nSitting silent by my side\n静静地坐在我身旁\nGoing on Holding hands\n请牵着我的手一起\nWalking through the nights\n度过这美好的夜晚\nHold me up Hold me tight\n请紧紧地抱住我\nLift me up to touch the sky\n让我感受这天空的辽阔\nTeaching me to love with heart\n让我用心爱这世界\nHelping me open my mind\n让我看到未来的精彩\nI can fly\n我可以飞翔\nI\'m proud that I can fly\n很高兴我可以飞翔\nTo give the best of mine\n我愿撒下心中的善意\nTill the end of the time\n就这样一直努力下去\nBelieve me I can fly\n请相信我可以飞翔\nI\'m proud that I can fly\n很高兴我可以飞翔\nTo give the best of mine\n也请让我追逐自己的梦想\nThe heaven in the sky\n找到心中的天堂\n\n\n\nStars in the sky\n望着夜空闪烁的明星\nWishing once upon a time\n想起曾经的愿望是多么美好\nGive me love Make me smile\n请给我你的爱，让我去微笑面对这一切\nTill the end of life\n直到我生命的尽头\nHold me up Hold me tight\n请紧紧地抱住我\nLift me up to touch the sky\n让我感受这天空的辽阔\nTeaching me to love with heart\n让我用心爱这世界\nHelping me open my mind\n让我看到未来的精彩\nI can fly\n我可以飞翔\nI\'m proud that I can fly\n很高兴我可以飞翔\nTo give the best of mine\n我愿撒下心中的善意\nTill the end of the time\n就这样一直努力下去\nBelieve me I can fly\n请相信我可以飞翔\nI\'m proud that I can fly\n很高兴我可以飞翔\nTo give the best of mine\n也请让我追逐自己的梦想\nThe heaven in the sky\n找到心中的天堂\n\nCan\'t you believe that you light up my way\n你不相信吗是你给我带来了一束光\nNo matter how that ease my path\n让我总能看到前方的路\nI\'ll never lose my faith\n我会永远保持自信\nSee me fly\n你看我在飞翔\nI\'m proud to fly up high\n很幸福我飞得越来越高\nShow you the best of mine\n也让你看到了全力拼搏的自己\nTill the end of the time\n就这样一直努力下去\nBelieve me I can fly\n请相信我可以飞翔\nI\'m singing in the sky\n我在蓝天上大声歌唱\nShow you the best of mine\n让你看到积极向上的自己\nThe heaven in the sky\n看到我心中的天堂\n\nNothing can stop me\n我会勇敢走下去\nSpread my wings so wide\n随着梦想的翅膀渐渐展开', 'article-mv', '2020-12-23 15:11:22');
INSERT INTO `el_material` VALUES ('23700d890d5a41659fb275174e91bd14', '32b3d188a504438f8d867bc86afbdeb7', 'Far Away From Home', '<iframe src=\"https://player.bilibili.com/player.html?cid=23910025&aid=14667336&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\nI\'m loving living every single day\n我是如此的享受每一天的生活\n\nBut sometimes I feel so\n但我只是自己不时这样感觉而已\n\nI hope to find a little peace of mind\n我渴望找寻到一丝内心的平静\n\nAnd I just want to know\n我仅仅只是想知道\n\nAnd who can heal those tiny broken hearts\n谁能安抚那些破碎的心\n\nAnd what are we to be\n我们将何去何从\n\nWhere is home on the milkyway of stars\n在广阔的星空下何处寻到我的家\n\nI dry my eyes again\n我只得再一次地擦干泪眼\n\nIn my dreams I\'m not so far away from home\n梦中我从未曾远离家园\n\nWhat am I in a world so far away from home\n现实中却如此远离家园\n\nAll my life all the time so far away from home\n有生以来我都远离家园\n\nWithout you I\'ll be so far away from home\n没有你的相伴我依然远离家园\n\nIf we could make it through the darkest night\n如果我们能穿越那最为黑暗的夜\n\nWe\'d have a brighter day\n我们将能拥有更光明的明天\n\nThe world I see beyond your pretty eyes\n透过你那明眸我看到了一个世界\n\nMakes me want to stay\n它是如此让我留恋\n\nAnd who can heal those tiny broken hearts\n谁能治愈那破碎的心\n\nAnd what are we to be\n我们将何去何从\n\nWhere is home on the milkyway of stars\n渺茫星空 何处是家园\n\nI dry my eyes again\n我只得再一次地擦干眼泪\n\nIn my dreams I\'m not so far away from home\n梦中我从未曾远离家园\n\nWhat am I in a world so far away from home\n现实中却如此远离家园\n\nAll my life all the time so far away from home\n有生以来我都远离家园\n\nWithout you I\'ll be so far away from home\n没有你的相伴我依然远离家园\n\nI count on you no matter what they say\n我是如此的依恋你 无论世人如何评说\n\nCause love can find it\'s time\n爱能找到属于自己的季节\n\nI hope to be a part of you again\n我渴望再一次的与你相融\n\nBaby let us shine\n爱的结晶令我们沐浴光辉\n\nAnd who can heal those tiny broken hearts\n谁能安慰那些破碎的心\n\nAnd what are we to be\n我们将何去何从\n\nWhere is home on the milkyway of stars\n渺茫星空 何处是家园\n\nI dry my eyes again\n我只得再一次地擦干泪眼\n\nIn my dreams I\'m not so far away from home\n梦中我从未曾远离家园\n\nWhat am I in a world so far away from home\n现实中却如此远离家园\n\nAll my life all the time so far away from home\n有生以来我都远离家园\n\nWithout you I\'ll be so far away from home\n没有你的相伴 我依然远离家园\n\nIn my dreams I\'m not so far away from home\n梦中我从未曾远离家园\n\nWhat am I in a world so far away from home\n现实中却如此远离家园\n\nAll my life all the time so far away from home\n有生以来我都远离家园\n\nWithout you I\'ll be so far away from home\n没有你的相伴 我依然远离家园', 'article-mv', '2020-12-12 21:48:35');
INSERT INTO `el_material` VALUES ('250554f46d664b388cfe0e21fee43dc6', '32b3d188a504438f8d867bc86afbdeb7', 'Stay - Tonya Mitchell', '<iframe src=\"https://player.bilibili.com/player.html?cid=14234124&aid=8642565&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\nI\'ve must have been blind\n我一定已经迷茫了\n\nNot to see you look away from me\n怎没看见你远离我的视线\n\nWhenever you say You love me still\n无论何时你说：“你还爱着我”\n\nI must have been crazy\n我一定会疯狂的\n\nNot to feel you slip away from me\n始终没注意到你的逃脱\n\nDay after day there\'s a space to fill\n久而久之空虚就会填满心间\n\nand I can\'t find the words to make you fall in love with me agian\n而我也找不到什么理由让你再次爱上我\n\nand I can\'t find the strength to let you go oh oh\n我也无力抗拒你的离去\n\nAnd when it\'s all said and done you\'ll be the only one\n当一切说到做到时，你就是我的唯一了\n\nEven if there\'s nothing left for us to say\n即使我们无言以对\n\nas sure as the sun will rise I can never say goodbye\n只要太阳照常升起，我绝不会说再见\n\nEven if we go are separate ways\n即使我们分道扬镳\n\nIn my heart you\'ll always stay\n你都会常驻我心田\n\nooh ooh\n哦……哦……\n\nBeen spending my time to try to remind you of our love\n哪怕用尽我一生的时间，也要唤醒你记忆中我们曾经的爱\n\nBut you\'re pulling away with every touch\n但你总是推脱掉一切接触\n\nWith all we\'ve been though\n我们经历了那么多\n\nI\'d never thought i\'d be losing you\n我却从未想过会失去你\n\nand i would give everything to keep you here\n我会竭尽全力让你重回我身边\n\nBut I can\'t (but I can\'t) find the words\n但我却找不到什么理由\n\nto make you fall in love with me again\n让你再次爱上我\n\nand I can\'t find the strength to let you go oh oh\n我也无力抗拒你的离去\n\nAnd when it\'s all said and done you\'ll be the only one\n当一切说到做到时，你就是我的唯一了\n\nEven if there\'s nothing left for us to say (nothing left to say)\n即使我们无言以对\n\nas sure as the sun will rise I can never say goodbye\n只要太阳照常升起，我绝不会说再见\n\nEven if we go are separate ways (ooh)\n即使我们分道扬镳\n\nIn my heart you\'ll always stay\n你都会常驻我心田\n\nI I I still believe our love meant to be oh\n我一直相信我们命定的爱\n\nAnd it will be here forever come one day (come one day) ooh ohoh\n它长存于此，终有一天会回来\n\ncan you see I love you faithfully oh yeh\n你还不明白我对你不渝的爱？\n\nAnd one day im telling you I find a way to get back to me ooh\n有一天我会告诉你，我们的爱会带你回到我身边\n\nAnd when it\'s all said and done\n当一切说到做到时\n\nyou\'ll be the only one\n你就是我的唯一了\n\nOooh nothing left to say\n哦……无言以对\n\nas sure as the sun will rise I can never say goodbye\n只要太阳照常升起，我绝不会说再见\n\nEven if we go separate ways\n即使我们分道扬镳\n\nIn my heart you\'ll always stay\n你都会常驻我心田\n\nOohh umm\n哦……呜……\n\nOoohh\n哦……', 'article-mv', '2021-01-20 21:14:19');
INSERT INTO `el_material` VALUES ('28453e16810e433d86bab3a9b9f88217', '32b3d188a504438f8d867bc86afbdeb7', '世界名著告诉你心碎的感觉（上）', '**1.The Fault in Our Stars, John Green**\n<font color=#006200>《星运里的错》 约翰·格林</font>\n\n**\"Oh, I wouldn\'t mind, Hazel Grace. It would be a privilege to have my heart broken by you.\"**\n<font color=#006200>“我不介意，哈泽尔▪格雷斯。我很荣幸你能让我心碎。”</font>\n\n**Why this breaks your heart: When you’re in that first yearning stage — standing on the outer edges of love and peering into it — you think that surely you can withstand any heartbreak that may result from lending your heart to someone else. You beautiful fool.**\n<font color=#006200>心碎理由：最初的时候，你站在爱的边缘、窥探其中，任何因为全心全意爱一个人而心碎的痛苦、你都认为自己能够承受。你个美丽的傻瓜。</font>\n \n\n\n**2.Anne of Green Gables, L.M. Montgomery**\n<font color=#006200>《绿山墙的安妮》 露西·莫德·蒙哥马利</font>\n\n**There is no use in loving things if you have to be torn from them. Is there? And it\'s so hard to keep from loving things, isn\'t it?**\n<font color=#006200>因为爱一个人而受到伤害有什么意义呢？但不去爱又真的很难，不是吗？</font>\n\n**Why this breaks your heart: You know too well that all beginnings have their endings, even if they\'re way off somewhere far. It’s tempting to try and protect your heart to keep it from ever breaking. But! A heart that\'s never used is also broken.**\n<font color=#006200>心碎理由：你心知肚明，任何开始都有结尾，即使它们偏离了最初的终点。人会出于本能地保护自己的心免受破碎之苦，但是！如果你连尝试爱的勇气都没有，那么你也会感受到心碎之苦。</font>\n \n\n\n**3.The Wonderful Wizard of Oz, L. Frank Baum**\n<font color=#006200>《绿野仙踪》 莱曼·弗兰克·鲍姆</font>\n\n**I think you are wrong to want a heart. It makes most people unhappy. If you only knew it. You are in luck not to have a heart.**\n<font color=#006200>我认为你想拥有一颗心的想法是错误的。心，让大部分人都不开心，如果你知道这一点，就会庆幸自己没有心是多么的幸运。</font>\n\n**Why this breaks your heart: Because to live is to be hurt, although that shouldn\'t ever stop you from doing all that awful, wonderful,bittersweet living.**\n<font color=#006200>心碎理由：虽然你会经历糟糕、美好、苦乐参半的生活，但只要活着就会受伤。</font>\n \n\n\n**4.The Little Mermaid, Hans Christian Andersen**\n<font color=#006200>《海的女儿》 汉斯·克里斯蒂安·安徒生</font>\n\n**Never had she danced so beautifully; the sharp knives cut her feet, but she did not feel it, for the pain in her heart was far greater.**\n<font color=#006200>她从没有跳得那么美；锋利的刀伤到了她的脚，但是她没有感觉到，因为她的心远比伤口痛。</font>\n\n**Why this breaks your heart: Sometimes you put yourself out there and, well. And nothing.**\n<font color=#006200>心碎理由：有时你只能硬撑着着，强颜欢笑。痛苦让你无话可说。</font>\n \n\n\n**5.Sin City, Vol. 3, Frank Miller**\n<font color=#006200>《罪恶之城》（第三卷） 弗兰克·米勒</font>\n\n**The fire, baby. It\'ll burn us both. There\'s no place in this world for our kind of fire. My warrior woman. My valkyrie. You\'ll always be mine. Always. And never.**\n<font color=#006200>亲爱的，爱火让我们燃烧起来。但这世上容不下我们的爱火。我的女勇士，我的女武神，你一直都是我的。虽然我们永远不能真正在一起。</font>\n\n**Why this breaks your heart: Sometimes you put yourself out there, placing your heart in someone else\'s hands, and the obstacles are two great for both of you to overcome intact. The love is there. But sometimes that‘s not enough.**\n<font color=#006200>心碎理由：有时候你倾尽所有，让自己全心全意爱一个人。但是阻碍太大，无法克服。爱虽在，但有时候仅仅有爱却不能在一起、是不够的。</font>\n \n\n\n**6.My Mortal Enemy, Willa Cather**\n<font color=#006200>《不共戴天的仇敌》 薇拉·凯瑟</font>\n\n**People can be lovers and enemies at the same time, you know.**\n<font color=#006200>你知道吗，人可以同时是情人和敌人。</font>\n\n**Why this breaks your heart: You are all too aware that you can adore someone with your whole stupid heart, and yet hate them with your whole entire mind. Someone can be right AND wrong for you.**\n<font color=#006200>心碎理由：你很清楚，自己可以用那愚蠢的心去溺爱一个人，但是恨他们的时候，用的却是你的整个大脑。对你来说，和这个人在一起既是对的、又是错的。</font>', 'article-essay', '2021-01-05 10:51:47');
INSERT INTO `el_material` VALUES ('285961d104c3425eaad4bfc9a27a5c29', '32b3d188a504438f8d867bc86afbdeb7', 'Enya - Only Time', '<iframe src=\"https://player.bilibili.com/player.html?cid=196626544&aid=497597838&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n作词 : Roma Ryan\n作曲 : Eithne Ní Bhraonáin\n\nWho can say where the road goes\'\n谁能说得清未来会发生什么\n\nWhere the day flows\n我们的时间都哪去了\n\nOnly time...\n只有时光才知道\n\nAnd who can say if your love grows\'\n谁能说得清当你心生爱意时\n\nAs your heart chose\n你的内心会如何选择\n\nOnly time...\n只有时光才知道答案\n\nWho can say why your heart sighs\'\n谁能说得清为什么你的内心在感伤\n\nAs your love flies\n当你的心早已千疮百孔的时候\n\nOnly time...\n只有时光才知道原因\n\nAnd who can say why your heart cries\'\n谁能说得清为什么你的内心在哭泣\n\nWhen your love dies\n当你早已对爱情麻木的时候\n\nOnly time...\n只有时光才明白\n\nWho can say when the roads meet\'\n谁能说得清命运之路何时将继续相遇\n\nThat love might be\'\n爱的火花或许还能重燃\n\nIn your heart.\n当你的心做出选择时\n\nAnd who can say when the day sleeps\'\n当白天早已深沉地睡去\n\nIf the night keeps all your heart\n但深夜仍然占据了你内心的一切\n\nNight keeps all your heart...\n使你彻夜难眠\n\nWho can say if your love grows\'\n谁能说得清当你心生爱意时\n\nAs your heart chose\n你的内心会如何选择\n\nOnly time...\n只有时光才知道答案\n\nAnd who can say where the road goes\'\n谁能说得清未来会发生什么\n\nWhere the day flows\n我们的时间都哪去了\n\nOnly time...\n只有时光才知道\n\nWho knows\n谁又能知道呢\n\nOnly time...\n只有时光\n\nWho knows\n谁又能知道呢\n\nOnly time...\n只有时光', 'article-mv', '2020-12-07 19:02:15');
INSERT INTO `el_material` VALUES ('3517f6ae9b004ff89ae532e2a8c6551f', '32b3d188a504438f8d867bc86afbdeb7', 'Cry On My Shoulder', '<iframe frameborder=\"no\" border=\"0\" marginwidth=\"0\" marginheight=\"0\" width=\"100%\" height=86 src=\"//music.163.com/outchain/player?type=2&id=17194024&auto=0&height=66\"></iframe>\n\nIf the hero never comes to you\n如果你的真命天子迟迟没有现身\n\nIf you need someone you\'re feeling blue\n如果你在伤心难受时感到寂寞与孤独\n\nIf you wait for love and you\'re alone\n如果你求爱而不得，孑然一身，无依无靠\n\nIf you call your friends and nobody\'s home\n如果你打电话给你的朋友，却没有一人在家\n\nYou can run away but you can\'t hide\n你可以甩掉烦恼，但你躲不掉\n\nThrough a storm and through a lonely night\n漫漫长夜，与暴风冰雪作伴\n\nThen I show you there\'s a destiny\n人生总有一条不变的真理\n\nThe best things in life\n最昂贵的东西\n\nThey\'re free\n你赶不走，却也买不来\n\nBut if you wanna cry\n但如果你心疲力竭，想要大哭一场\n\nCry on my shoulder\n就趴在我的肩头尽情啜泣吧\n\nIf you need someone who cares for you\n我会对你不离不弃，永远的关心在意着你\n\nIf you\'re feeling sad your heart gets colder\n或许你已心如死灰，不再起一点涟漪\n\nYes I\'ll show you what real love can do\n但我依旧会用我爱你的心将它暖化\n\nIf your sky is grey oh let me know\n如果你感到人生灰暗，请让我知悉\n\nThere\'s a place in heaven where we\'ll go\n我们终会去往无忧无虑，粉花碧木的天堂\n\nIf heaven is a million years away\n不过我们还年轻，距离天堂太远太远\n\nOh just call me and I make your day\n所以你只需要给我来个电话，我会尽我所能为你打造一个乌托邦\n\nWhen the nights are getting cold and blue\n当夕阳西下之时，夜晚寒冷又孤寂\n\nWhen the days are getting hard for you\n当人生迷茫之际，前途无依又无靠\n\nI will always stay here by your side\n不过不论怎样，我都会紧紧的跟随着你\n\nI promise you I\'ll never hide\n我向你保证，我永远会保护你\n\nBut if you wanna cry\n但如果你心疲力竭，想要大哭一场\n\nCry on my shoulder\n就趴在我的肩头尽情啜泣吧\n\nIf you need someone who cares for you\n我会对你不离不弃，永远的关心在意着你\n\nIf you\'re feeling sad your heart gets colder\n或许你已心如死灰，不再起一点涟漪\n\nYes I show you what real love can do\n但我依旧会用我爱你的心将它暖化\n\nBut if you wanna cry\n但如果你心疲力竭，想要大哭一场\n\nCry on my shoulder\n就趴在我的肩头尽情啜泣吧\n\nIf you need someone who cares for you\n我会对你不离不弃，永远的关心在意着你\n\nIf you\'re feeling sad your heart gets colder\n或许你已心如死灰，不再起一点涟漪\n\nYes I show you what real love can do\n但我依旧会用我爱你的心将它暖化\n\nWhat real love can do\n凭借一颗爱你的心\n\nWhat real love can do\n凭借一份真挚的爱\n\nWhat love can do\n爱情的力量是无穷的\n\nWhat love can do\n但我只想要\n\nlove can do\n能拯救你的力量', 'article-song', '2020-12-07 18:43:08');
INSERT INTO `el_material` VALUES ('41ead83f539d4f8aad0e75e28d94b20a', '32b3d188a504438f8d867bc86afbdeb7', 'My Heart Will Go On', '<iframe src=\"https://player.bilibili.com/player.html?cid=103635683&aid=59480791&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n作词 : Will Jennings\n作曲 : James Horner\n\nEvery night in my dreams\n在我的每一个梦中\n\nI see you\n我都能看到你\n\nI feel you\n我都能感受到你\n\nThat is how I know you go on\n我便确定了，你在永恒不变的跟随着我\n\nFar across the distance\n跨越距离\n\nAnd spaces between us.\n无论生死\n\nYou have come to show you go on\n你悄悄的来找我，证明你的灵魂永存\n\nNear far,\n或远或近\n\nwherever you are\n无论你身在何方\n\nI believe that the heart does go on\n我都相信，我们的心是亘古不变的\n\nOnce more,\n你再一次\n\nyou open the door,\n悄悄打开了我的房门\n\nAnd you\'re here in my heart.\n你已被深深的刻在了我的心里\n\nAnd my heart will go on and on\n便会随着我的心一起，在这世界上永存\n\nLove can touch us one time.\n也许我们的爱情，只是昙花一现\n\nAnd last for a lifetime\n但这份爱情也伴我终身\n\nAnd never let go till we\'re gone,\n这份爱情不会湮于岁月，只要我还活着\n\nLove was when I loved you\n当我与你心心相依时，才感受到了爱情\n\nOne true time I hold to.\n那是真实又纯真的爱情\n\nIn my life we\'ll always go on.\n只要我还在世，你我就会并肩前行，青史留名\n\nNear far,\n或远或近\n\nwherever you are\n无论你身在何方\n\nI believe that the heart does go on\n我都相信我们的心是亘古不变的\n\nOnce more,\n再一次吧\n\nyou open the door,\n再悄悄的打开我的房门\n\nAnd you\'re here in my heart,\n你已被深深的刻在了我的心里\n\nAnd my heart will go on and on\n便会随着我的心一起，在这世界上永远的活下去\n\nYou\'re here,\n只要你伴随着我\n\nYou\'re here,\n只要你伴随着我\n\nthere\'s nothing I fear.\n我便会勇敢起来，不惧任何事物\n\nAnd I know that my heart will go on\n我也知道，我的心必将永恒\n\nwe\'ll stay forever this way.\n你也会一直一直的伴随在我的身边\n\nYou are safe in my heart,\n最安全的地方也比不上我的心里\n\nand my heart will go on and on\n因为你会和我的心一起，在这世界上永远的活下去', 'article-mv', '2020-12-09 11:26:52');
INSERT INTO `el_material` VALUES ('44f2da6e40ef4b4497bfa07a13071671', '32b3d188a504438f8d867bc86afbdeb7', 'A Letter to a Foreign Friend Who Wants to Teach English in China', '![caniteachenglishabroadifimanonnativespeaker_1780282505.jpg](http://blog.yongkj.cn/2020/11/23/teach-English-in-China/caniteachenglishabroadifimanonnativespeaker_1780282505.jpg)\n\n**Dear Tom,**\n&emsp;&emsp;**On hearing that you are planning to teach English in China and inquire which city to work in, I\'d like to recommend** our capital city Beijing to you, which is an international metropolis.\n&emsp;&emsp;**The reasons why I recommend Beijing can be listed as follows. First of all,** there are a lot of English-speaking foreigners in Beijing, which could help you adapt to life here very quickly. **Furthermore,** as the capital of several dynasties, Beijing has a profound cultural background, so you can better experience the extensive and profound traditional Chinese culture in Beijing. **Most importantly,** parents in Beijing attach great importance to their children\'s English learning and many people who work in multinational companies also need to learn English.\n&emsp;&emsp;**I truly hope that** you can come to Beijing to start your teaching life and I\'m looking forward to your arrival. **If you have any question about** the city, **please feel free to contact me for further information.**\n**<p align=\"right\">Yours sincerely,<br>Li Ming</p>**', 'article-essay', '2020-12-09 11:05:15');
INSERT INTO `el_material` VALUES ('45c1eb3715c4421ab200ba7ec0c0298c', '32b3d188a504438f8d867bc86afbdeb7', '英语元音', '双元音', 'vowel-3', '2020-09-26 09:52:46');
INSERT INTO `el_material` VALUES ('4d6760ad46e149bdacf741c136cb2985', '32b3d188a504438f8d867bc86afbdeb7', 'Black Friday', '![aeks5-6xv3g.jpg](http://file.yongkj.cn/fileSystem/admin/Resources/英语随身学/assets/Picture/aeks5-6xv3g.jpg)\n\n关于“黑色星期五”的由来，众说纷纭，其中一种说法是：\n\n美国圣诞节前大采购一般是从感恩节之后开始的。感恩节是每年11月的第4个星期四，因此它的第二天，也就是周五，是美国人大采购的第一天。在这一天，美国的商场都会推出大量的打折和优惠活动，以在年底进行最后一次大规模的促销。因为美国的商场一般以红笔记录赤字，以黑笔记录盈利，而感恩节后的这个星期五人们疯狂的抢购使得商场利润大增，因此被商家们称作黑色星期五。\n\n而今年，受疫情的影响，美国“黑色星期五”发生了一些变化。2020年11月28日的《经济学人》中有篇文章对此进行了报道，我们一起来看一下：\n\n<center><font color=red>预习</font></center>\n\n大家先自己浏览一遍原文，回答下面几个问题：\n1. “黑色星期五”是怎么来的？\n2. “网络星期一”是怎么回事？\n3. 今年的“黑五”发生了什么变化？\n\n&emsp;&emsp;The start of the pre-Christmas shopping season, which this year <font color=red>falls on</font> November 27th, has long been a <font color=red>bonanza</font> for American retailers. The term itself <font color=red>is often credited to</font> Philadelphia’s policemen, who used it to describe the <font color=red>pandemonium</font> caused by suburban shoppers and tourists <font color=red>thronging the city</font> ahead of the annual Army-Navy American-football game on the Saturday after Thanksgiving. By the 1980s shops recognised <font color=red>the branding opportunity</font>—and began <font color=red>marking the occasion with deep discounts and “doorbuster” deals</font> to pull people from their <font color=red>turkey-laden</font> tables to shopping aisles. \n\n&emsp;&emsp;These days retailers make one-fifth of their holiday revenue, defined as sales in November and December, in the five days from Thanksgiving to <font color=red>Cyber Monday</font>, invented in 2005 by the National Retail Federation (NRF), a trade group, <font color=red>in recognition of an online sales bump</font> on the first working day after the holiday weekend. Black Friday typically attracts more than twice the <font color=red>foot traffic</font> of other annual <font color=red>shopping sprees</font> in America. \n\n&emsp;&emsp;This year, though, covid-19 has made many shoppers reluctant to <font color=red>elbow their way to cut-price wedding gowns or TV sets</font>. So large retailers have, like Best Buy, <font color=red>stretched</font> Black Friday from <font color=red>a frenzied 24 hours</font> to several weeks. Walmart, Target and other big-box retailers announced discounts on holiday items as early as October 11th.\n\n**文章翻译：**\n\n<center><font color=red>第一段</font></center>\n\n①The start of the pre-Christmas shopping season, which this year falls on November 27th, has long been a bonanza for American retailers.\n\n对美国零售商来说，圣诞节前购物季的第一天(今年是11月27日)一直是个赚钱良机。\n\n②The term itself is often credited to Philadelphia’s policemen, who used it to describe the pandemonium caused by suburban shoppers and tourists thronging the city ahead of the annual Army-Navy American-football game on the Saturday after Thanksgiving.\n\n这个词通常要归功于费城警察。每年感恩节后的星期六，费城都会举办“陆军——海军美式橄榄球比赛”，在比赛前一天，郊区购物者和游客把城市挤得水泄不通，造成混乱。费城警察就用这个词来形容这种混乱局面。\n\n③By the 1980s shops recognised the branding opportunity—and began marking the occasion with deep discounts and “doorbuster” deals to pull people from their turkey-laden tables to shopping aisles.\n\n到20世纪80年代，店家意识到这是一次宣传品牌的机会——并开始在当天推出超大折扣和“开门大抢购”的商品，以把人们从摆满火鸡的桌子上拉到购物通道。\n\n<center><font color=red>第二段</font></center>\n\n①These days / retailers make one-fifth of their holiday revenue, / defined as sales in November and December, / in the five days from Thanksgiving to Cyber Monday, / invented in 2005 by the National Retail Federation (NRF), a trade group, / in recognition of an online sales bump on the first working day after the holiday weekend.\n\n在感恩节假期结束后的第一个工作日，线上销售会出现一个高峰，为此，全美零售商联合会（一个贸易组织）在2005年创造了“网络星期一”这一概念。从感恩节到网络星期一的这五天时间里，商家收入占据了假期（11月和12月）收入的1/5。\n\n②Black Friday typically attracts more than twice the foot traffic of other annual shopping sprees in America.\n\n“黑色星期五”吸引的客流量是美国其它年度购物狂潮的两倍以上。\n\n<center><font color=red>第三段</font></center>\n\nThis year, though, covid-19 has made many shoppers reluctant to elbow their way to cut-price wedding gowns or TV sets. So large retailers have, like Best Buy, stretched Black Friday from a frenzied 24 hours to several weeks. Walmart, Target and other big-box retailers announced discounts on holiday items as early as October 11th.\n\n但今年，新冠疫情让许多购物者不愿挤向商场抢购打折婚纱或电视机。所以像百思买这样的大型零售商已经把“黑色星期五”从疯狂的24小时延长到了几个星期。沃尔玛、塔吉特和其他大型零售商早在10月11日就宣布了节日商品折扣。\n\n>其实，延长购物节的真正目的是为了截获更多流量。今年淘宝的“双11”也提前至10月21号，离真正的“双11”足足提前了半个多月。这也是阿里的苦衷：最一开始，阿里提出“双11”的概念，砸钱宣传、造势，取得巨大成功。但后来，一些年轻电商眼红了，拼多多、抖音、快手纷纷从11月1号开始搞优惠，提前了10天，抢走了阿里的很多流量。\n>\n>这下阿里能忍？今年直接把“双11”提前到10月21号，谁也别抢。\n>\n>西方零售商把“黑五”提前到10月11日，也是一样的道理，在今年新冠疫情的冲击下，人们消费意愿不强，商家都想多抢点顾客，挽回损失。', 'article-essay', '2020-12-08 11:12:13');
INSERT INTO `el_material` VALUES ('61518cac24dc42969470928bf9e16c07', '32b3d188a504438f8d867bc86afbdeb7', '26个英语字母发音表 – 英语音标', '英语字母是组成英语单词的最小单位，你可以把英语字母想象成汉字中的“笔划”，如横竖撇捺折。26个英语字母发音表，指的是每个字母的发音，用于互相区分，和音标是两码事。 # 音频资料来自剑桥字典的26个英语字母发音转录，每个字母发音两次，按照英式发音和美式发音的顺序。', 'alphabet', '2020-09-20 23:16:11');
INSERT INTO `el_material` VALUES ('66ca022f44e040f5ae04935568148622', '32b3d188a504438f8d867bc86afbdeb7', 'Enya - Caribbean Blue', '<iframe src=\"https://player.bilibili.com/player.html?cid=196625597&aid=540380773&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\nCaribbean Blue\n蔚蓝的加勒比海\n\n... Eurus...\n尤洛斯（东风之神）\n\n... Afer Ventus...\n阿弗梵图斯（西南风神）\n\n... so the world goes round and round\n地球不停旋转\n\nwith all you ever knew\n正如你所预见\n\nThey say the sky high above\n他们说遥远的天际边\n\nis Caribbean blue...\n是神秘的加勒比幽蓝\n\n... if every man says all he can,\n倘若世人都说无所不能\n\nif every man is true,\n如果其言也真\n\ndo I believe the sky above\n我坚信遥远的天际边\n\nis Caribbean blue...\n是寂静的加勒比幽蓝\n\n... Boreas...\n波瑞斯（北风之神）\n\n... Zephryus...\n芮弗瑞斯（西风神）\n\n... if all you told was turned to gold,\n假使你的所言真实如金\n\nif all you dreamed was new,\n假使你所梦焕然如新\n\nimagine sky high above\n幻想在遥远的天际边\n\nin Caribbean blue...\n是灵动的加勒比幽蓝\n\n... Eurus...\n尤洛斯（东风之神）\n\nAfer Ventus...\n阿弗梵图斯（西南风神）\n\n... Boreas\n波瑞斯（北风之神）\n\nZephryus...\n芮弗瑞斯（西风神）\n\n... Africus...\n阿弗瑞库斯（西南风的化身）\n\nChords\n歌词结束。', 'article-mv', '2020-12-07 20:11:58');
