INSERT INTO `el_material` VALUES ('8c2cd4f0abf54f5493d6163493157a9d', '32b3d188a504438f8d867bc86afbdeb7', 'The Importance of Reading Ability and How to Develop It', '![Reflecting-through-stages-of-Reading-1024x683.jpg](http://blog.yongkj.cn/2020/11/05/improve-reading-skills/Reflecting-through-stages-of-Reading-1024x683.jpg)\n\n&emsp;&emsp;**As the most frequently used way to get access to the original material,** reading has always been considered one of the most important parts of language learning. **This explains why reading skills should be highly emphasized.**\n&emsp;&emsp;Then how to improve our reading skills? **First of all,** scan the material before we begin. Whatever the purpose of our reading is, take a few minutes to look the piece over to check and see how the work is structured and presented. **Secondly,** try not to reach for the dictionary when we come to a word we don\'t know. Instead, try to guess the meaning of the word based on the context. **Last but not least,** write a few sentences to summarize what we\'ve read since it is a way of checking that we understand what we\'re reading.\n&emsp;&emsp;**Above all,** reading has important benefits and can help us learn the language faster and more completely, which encourages each language learner to develop their reading skills as suggested.', 'article-essay', '2020-12-07 17:31:39');
INSERT INTO `el_material` VALUES ('96eab3e5e9864796a83b4793f8691851', '32b3d188a504438f8d867bc86afbdeb7', 'Traveling by Plane', '![Air-Travel.jpg](http://blog.yongkj.cn/2020/11/05/traveling-by-plane/Air-Travel.jpg)\n\n&emsp;&emsp;In the past, traveling by plane was unimaginable for most Chinese people. Today, with development of China\'s economy and the improvement of people\'s living standards, more and more Chinese people, including many farmers and migrant workers, can travel by air. They can fly to all major cities, and many other cities are also planning to build airports. Air services continue to improve, and there are often cheap flights. In recent years, the number of people choosing to travel by air during holidays has been increasing.\n\n&emsp;&emsp;过去，乘飞机出行对大多数中国人来说是难以想象的。如今，随着经济的发展和生活水平的提高，越来越多的中国人包括许多农民和外出务工人员都能乘飞机出行。他们可以乘飞机到达所有大城市，还有很多城市也在筹建机场。航空服务不断改进，而且经常会有廉价机票。近年来，节假日期间选择乘飞机外出旅游的人数在不断增加。', 'article-essay', '2020-12-10 19:46:03');
INSERT INTO `el_material` VALUES ('9f9ff995d52b4211909ba64e56e60460', '32b3d188a504438f8d867bc86afbdeb7', 'Tomorrow Will Be Better - ATT 9', '<iframe src=\"https://player.bilibili.com/player.html?cid=23035911&aid=14110398&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n歌手：ATT-9 多重演唱团\n\n歌词：\n\nWhen you wake up in the morning \n\n当你早晨醒来\n\nWhen you haven\'t started to think \n\n当你还没来bai得及思考时\n\nThere is a whole brand new day \n\n又是崭新的一天\n\nOpen wide and waiting for you \n\n张开双臂在等待着你\n\nI know in life\'s sorrow \n\n我知道生活的不如意\n\nyou\'re on the verge of drowning \n\n使你处于频死的边缘\n\nMay your tears flee with yesterday \n\n也许你昨天流下泪水\n\nblow away with the wind\n\n已随风逝去\n\nWhen you wake up in the morning \n\n当你早晨醒来\n\nWhen you haven\'t started to think \n\n当你还没来得及思考时\n\nThe world is out there calling \n\n外面的世界正呼唤着你\n\nopen eyes to new beginning \n\n睁开眼睛去迎接新的一天\n\nA newborn sun is shining \n\n被初升的太阳闪耀着\n\nChasing shadows from your mind \n\n驱逐你内心的阴影\n\nEverything will be alive,\n\n一切都将充满生机\n\nunder the sunshine\'s smile \n\n在阳光的笑脸下\n\nCome out from your corner \n\n从你的内心深处走出来\n\nNo doubt in join us \n\n不用怀疑加入我们吧\n\nYou can decide the future \n\n你可以把握自己的未来\n\nDevote your youthfulpower to this world \n\n为世界贡献你年轻的力量\n\nCome together hand in hand together \n\n来吧一起手拉手\n\nI know you\'ll do \n\n我知道你会这样做的\n\nWe pray and believe \n\n我们祈祷并相信\n\nthat tomorrow will be better.\n\n明天会更好\n\nNo, I don\'t know what your name is \n\n是的我并不知道你的名字\n\nBut you\'re so familiar to me \n\n但是对我来说你是那么的熟悉\n\nCause we belong to one family \n\n因为我们属于一个大家庭\n\nYou can hear my heart calling \n\n你可以听到我心灵的呼唤\n\nLife can be music,\n\n生活就像是音乐\n\nrainbows can be reached \n\n彩虹也可以触手可得\n\nIf you face yourself truly\n\n如果你能真实地面对自己\n\nkeep striving for your dream \n\n为了自己的梦不懈地努力\n\nCome out from your corner \n\n从你的内心深处走出来\n\nNo doubt in join us \n\n不用怀疑加入我们吧\n\nYou can decide the future \n\n你可以把握你的未来\n\nDevote your youthful power to this world \n\n为世界贡献你年轻的力量\n\nCome together, hand in hand together \n\n来吧一起手拉手\n\nI know you\'ll do \n\n我知道你会这样做的\n\nWe pray and believe \n\n我们祈祷并相信\n\nthat tomorrow will be better\n\n明天会更好\n\nWhen you wake up in the morning \n\n当你早晨醒来\n\nWhen you haven\'t started to think\n\n当你还没来得及思考时\n\nThere is a whole brand new day \n\n又是崭新的一天\n\nOpen wide and waiting for you \n\n正张开双臂等待着你\n\nI know in life\'s sorrow\n\n我知道生活的不如意\n\nyou\'re on the verge of drowning\n\n使你处于绝望的边缘\n\nMay your tears flee with yesterday\n\n也许你昨天流下的泪水\n\nBlow away with the wind \n\n已随风逝去\n\nCome out from your corner\n\n从你的内心深处走出来\n\nNo doubt in join us \n\n不用怀疑加入我们吧\n\nYou can decide the future\n\n你可以把握你的未来\n\nDevote your youthful power to this world \n\n为世界贡献你年轻的力量\n\nCome together, hand in hand together \n\n来吧一起手拉手\n\nI know you\'ll do \n\n我知道你会这样\n\nWe pray and believe \n\n我们祈祷并相信\n\nthat tomorrow will be better.\n\n明天会更好', 'article-mv', '2021-01-25 12:58:33');
INSERT INTO `el_material` VALUES ('b67f648714574adcbc214e4f260f0a2d', '32b3d188a504438f8d867bc86afbdeb7', '《冰雪奇缘》番外短片 -  从前有个雪人', '<iframe src=\"https://player.bilibili.com/player.html?cid=249257391&aid=755022946&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n<center>果然是《冰雪奇緣》的搞笑擔當，獨立短片也沒讓人失望！</center>\n<center>（笑）</center>\n\n![fe6700027b0f88cdf939.jpg](http://file.yongkj.cn/fileSystem/admin/Resources/英语随身学/assets/Picture/fe6700027b0f88cdf939.jpg)\n\n&emsp;&emsp;可愛逗趣的雪寶一直是《冰雪奇緣》系列中的人氣角色，尤其在《冰雪奇緣2》中的「戲中戲」之後，更是讓他的人氣攀上高峰，而迪士尼也看中了他的高人氣，為他推出「獨立短片」《Once Upon A Snowman》介紹雪寶的誕生起源。近期更釋出了預告，原來他在跟兩姐妹相認之前，就曾被艾莎的披風勾住而跌落懸崖，場面十分爆笑！\n\n&emsp;&emsp;《Once Upon A Snowman》找來《冰雪奇緣2》導演執導，也由原版電影卡司喬許蓋德（Josh Gad）來為雪寶親自配音，《Once Upon A Snowman》將於10月23日在Disney+上線。', 'article-film', '2020-12-09 10:00:42');
