INSERT INTO `el_material` VALUES ('bd7e019d772b49928878e9052a739e11', '32b3d188a504438f8d867bc86afbdeb7', 'God is A Girl - Groove Coverage', '<iframe src=\"https://player.bilibili.com/player.html?cid=285241866&aid=586333661&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\nRemembering me,\n记住我\n\nDiscover and see\n探索和发现\n\nAll over the world,\n这整个世界\n\nShe\'s known as a girl\n众所周知她是个女孩\n\nTo those who are free,\n对那些自由的人\n\nThe mind shall be key\n思想才是关键\n\nForgotten as the past\n忘记过去\n\n\'Cause history will last\n因为历史是过去\n\nGod is a girl,\n上帝是女孩\n\nWherever you are,\n不管你在哪\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl,\n上帝是女孩\n\nWhatever you say,\n不管你说什么\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl,\n上帝是女孩\n\nHowever you live,\n不管你的生活状态如何\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl,\n上帝是女孩\n\nShe\'s only a girl,\n她只是个女孩\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nShe wants to shine,\n她想与众不同\n\nForever in time,\n希望从某天开始能永远这样夺人眼球\n\nShe is so driven, she\'s always mine\n她是如此的有紧迫感，她一直是我的\n\nCleanly and free,\n干干净净的，自由的人\n\nShe wants you to be\n她想让你成为这样的人\n\nA part of the future,\n未来的某刻\n\nA girl like me\n一个像我一样的女孩\n\nThere is a sky,\n天空\n\nIlluminating us, someone is out there\n告诉我们，有个人在那儿\n\nThat we truly trust\n那个我们相信的人\n\nThere is a rainbow for you and me\n还有那给你我的那一抹彩虹\n\nA beautiful sunrise eternally\n以及那永远漂亮的日出\n\nGod is a girl\n上帝是女孩\n\nWherever you are,\n不管你在哪\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nWhatever you say,\n不管你说什么\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nHowever you live,\n不管你的生活状态如何\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nShe\'s only a girl,\n她只是个女孩\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nWherever you are,\n不管你在哪\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nWhatever you say,\n不管你说什么\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nHowever you live,\n不管你的生活状态如何\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩\n\nShe\'s only a girl,\n她只是个女孩\n\nDo you believe it, can you receive it?\n你相信吗？你会接受吗？\n\nGod is a girl\n上帝是女孩', 'article-mv', '2021-01-24 21:54:29');
INSERT INTO `el_material` VALUES ('be71ea2fc9334a3bab1d77aa8f81049c', '32b3d188a504438f8d867bc86afbdeb7', '魔兽世界：巫妖王之怒', '<iframe src=\"https://player.bilibili.com/player.html?cid=139203305&aid=81338188&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n&emsp;&emsp;故事背景主要叙述随着黑暗之门的打开，为了阻止燃烧军团的远征毁灭艾泽拉斯，战火已再度燃起，艾泽拉斯的英雄已经很少考虑诺森德大陆这片冰冻荒原，但古老的邪恶势力正在那里等待。已毁于战火的艾卓—尼布鲁王朝中蛰伏的邪灵和它们邪恶的统治者却并未遗忘艾泽拉斯。\n\n&emsp;&emsp;拥有圣骑士、死亡骑士和巫妖王三重力量的阿尔萨斯已经启动了可能导致艾泽拉斯所有生灵毁灭的计划，他的天灾军团和驱役亡灵的强大力量将横扫大陆。只有最强大的英雄才能在冰封的北方大陆上生存下来。怀抱阻止阿尔萨斯计划，甚至挑战巫妖王本人的愿望，英雄们认为永远终结他的一切恐怖统治的时刻来临了。\n\n&emsp;&emsp;在《魔兽争霸3：冰封王座》的剧情中，当阿尔萨斯与耐奥祖的精神合二为一，成为了新的巫妖王——《魔兽世界》中最强有力的个体之一。他现在正身处于冰冠冰川的深处，手持霜之哀伤，在冰封王座上沉思，指挥着天灾的不死军团。联盟和部落的英雄们将在诺森德的寒风和冰霜中与天灾军团进行殊死搏斗，并最终面对巫妖王。', 'article-film', '2020-12-09 11:18:58');
