INSERT INTO `el_material` VALUES ('c5d14523063046db8ae5f9c4b377f9b8', '32b3d188a504438f8d867bc86afbdeb7', 'RP音标诞生小历史', '<iframe src=\"https://player.bilibili.com/player.html?cid=56155756&aid=32099702&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\n&emsp;&emsp;标准英音RP，又称标准英语Standard English、女王英语、BBC英语。RP口音，往往与高贵优雅上流社会连在一起。\n\n&emsp;&emsp;语音学家Daniel Jones 1917年编写出版<剑桥英语正音词典>，将英音归纳总结并以音标标注。自此，这本词典便成为最具权威的RP发音指南', 'article-film', '2020-12-07 17:17:50');
