INSERT INTO `el_material` VALUES ('f2b3e45061a64f7db60e87bc2ead1f9e', '32b3d188a504438f8d867bc86afbdeb7', 'Caron Nightingale - Promises Don\'t Come Easy', '<iframe src=\"https://player.bilibili.com/player.html?cid=40634311&aid=24235343&page=1&as_wide=1&high_quality=1&danmaku=0\"\n	allowfullscreen=\"allowfullscreen\" width=\"100%\" height=\"500\" scrolling=\"no\" frameborder=\"0\" sandbox=\"allow-top-navigation allow-same-origin allow-forms allow-scripts\"></iframe>\n\nI should have known all along\n我早该察觉,自始至终\n\nthere was something wrong\n总有些不对\n\nI just never read between the lines\n我只是不曾深究\n\nThen I woke up one day\n有一天醒来\n\nand found you on your way\n发现你有你的路要走\n\nLeaving nothing but my heart behind\n什么都没说,把我的真心丢在脑后\n\nWhat can I do to make it up to you\n要我怎么做才能和你重归旧好\n\nPromises don\'t come easy\n诺言难许\n\nBut tell me if there\'s a way\n但只要你说有什么\n\nto bring you back home to stay\n能让你回到我身边\n\nWell I\'d promises anything to you\n那么让我承诺你什么都好\n\nI\'ve been walkin\' around\n我在路上漫无目的\n\nwith my head hanging down\n垂头丧气\n\nWondrin\' what I\'m gonna do\n想知道还可以做什么\n\nCause when you walked out that door\n因为自从你离开家\n\nI knew I needed you more\n我发现自己需要的是你\n\nThan to take a chance on losing you\n而不是要再有一次机会失去你\n\nWhat can I do to make it up to you\n要我怎样才能和你重归旧好\n\nPromises don\'t come easy\n诺言难许\n\nYou know I\'ve made up my mind\n我已经下定决心\n\nto make it work this time\n这次要给你承诺\n\nThat\'s the promise that I give to you\n这就是我给你的诺言\n\nYou never thought I loved you\n你从没想过我是爱你的\n\nI guess you never thought I cared\n我猜你不曾想到我在意你\n\nI was just too proud to say it out loud\n我只是太在乎我的骄傲 而不曾大声的说\n\nNow I know\n现在我知道\n\nto let my feelings go (so tell me)\n让我的感情去倾泻(所以告诉我)\n\nWhat can I do to make it up to you\n要我怎样才能和你重归旧好\n\nPromises don\'t come easy\n诺言难许\n\nYou know I\'ve made up my mind\n我已经下定决心\n\nto make it work this time\n这次要给你承诺\n\nThat\'s the promise I can give to you\n这就是我给你的诺言\n\nWhat can I do to make it up to you\n怎么才能和你重归旧好', 'article-mv', '2020-12-09 12:31:41');
